import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for product cards to load and click first "Add to Cart" button
    await page.waitForSelector('.product-card .add-to-cart', { timeout: 5000 });

    // Extract product details before clicking
    const productTitle = await page.$eval('.product-card .product-title', el => el.textContent.trim());
    const productPrice = await page.$eval('.product-card .product-price', el => {
      const text = el.textContent.trim();
      const match = text.match(/\$\d+\.\d+/);
      return match ? match[0] : text;
    });

    // Click the first Add to Cart button
    await page.click('.product-card .add-to-cart');

    // Wait for cart update and take confirmation screenshot
    await page.waitForTimeout(1000);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_add_to_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_add_to_cart.png'));

    return {
      success: true,
      action: "Added first product to cart",
      extractedData: {
        productTitle,
        productPrice
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to add first product to cart",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
